"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.sukuhistoria.fi/wiki/index.php/GARP,%26_(SANDIKA-%C3%84TTEN)<br />\n\"(SANDIKA-\u00c4TTEN) suku, Sandika, Hargs socken, Uppland, Swerige\n</p>\n<p>\n(SANDIKA-\u00c4TTEN) Erik Jonsson*e.1420-\u2020j.18.3.1454, herre till Sandika, Hargs socken, omn\u00e4mndes m\u00f6jligen 1420, vapen kluven sk\u00f6ld med halv lilja lapsia: (SANDIKA-\u00c4TTEN) Ragnhild\u20201449-58, *Uppland, Swe, 2&amp;, puoliso GARP J\u00f6ns Andersson*n.1347/n.e.1350-\u2020j.1407/1412, Myn\u00e4m\u00e4ki, Virmo/n.1440 Lemu, Fin*Letala, Lepist\u00f6, riksr\u00e5d, valtaneuvos, konungsdomhavande, esiintyy 1373-1407, Kuninkaantuomari Suomessa. lapsia: Kristina*1375/n.1380-+j.1435&amp;1399 Borg\u00e5\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
