"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://sukuhaku.genealogia.fi/#bookid=139&amp;page=59&amp;pageid=23130<br />\n\"Genos 1/2014 TRO 22.3.1648 Hartvig W\u00f6lichin leski Anna Gustafintyt\u00e4r pyysi lupaa saada korjata talonsa ja vuokrata sen. Jalosyntyinen Hans Thomasinpoika esitti 18.7.1576 p\u00e4v\u00e4tyn testamentin, jolla Kuggb\u00f6len Gabriel Sigfridinpoika j\u00e4tti rakkaalle vaimolleen Kirstin Olofintytt\u00e4relle kaiken kiinte\u00e4n ja irtaimen omaisuuden Turussa, mik\u00e4li heill\u00e4 ei olisi rintaperillisi\u00e4 h\u00e4nen kuollessaan. Vaimo Anna Gustafintyt\u00e4r hallitsi nyt t\u00e4t\u00e4 taloa ja Hans Thomasinpoika halusi saada siit\u00e4 osan, sill\u00e4 se oli langennut Gabriel Sigfridinpojan perint\u00f6osaksi. Vaimo Anna Gustafintyt\u00e4r ilmoitti lunastaneensa talon vierailta. Hans Thomasinpoika vastasi, ett\u00e4 talo oli lunastettu h\u00e4nen \u00e4itins\u00e4 sisaren hopella. Anna Gustafintyt\u00e4r halusi Hans Thomasinpojan n\u00e4ytt\u00e4v\u00e4n Gabrieli Sigfridinpojan ja h\u00e4nen sisarensa Birgitta Sigfridintytt\u00e4ren v\u00e4lisen perinn\u00f6njaon, johon Anna Gustafintytt\u00e4ren omistama osuus olisi merkitty. Brita Sigfridintyt\u00e4r oli perinnyt veljens\u00e4 Gabrielin ja Hartvig W\u00f6lichin omistus perustui t\u00e4h\u00e4n. Gabriel Sigfridinpoika ja Brita Sigfridintyt\u00e4r olivat myyneet talon Hans St\u00e4kelle ja t\u00e4m\u00e4 Hans Platzille. Hovioikeus oli kuitenkin purkanut kaupan, sill\u00e4 heid\u00e4n sisarensa Gertrud Sigfridintyt\u00e4r ei ollut hyv\u00e4ksynyt sit\u00e4. Gertrud Sigfridintyt\u00e4r oli ollut Anna Gustafintytt\u00e4ren anoppi. Kirstin Olofintyt\u00e4r puolestaan oli Hans Thomasinpojan \u00e4idin sisar. TRO 26.6. Johan Schultz huudatti Hartvig W\u00f6lichin leskelt\u00e4 ja t\u00e4m\u00e4n poikapuolelta Gustaf Gabrielinpojalta ostamansa talon.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
