"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://docplayer.fi/2670063-Haukilan-kylasuunnitelma-2007.html<br />\n\"Vanha jo rautakaudella asuttu Uskelan kyl\u00e4 oli alun perin l\u00e4hes samalla paikalla, jossa nyt on Haukilan kartano. Vanhin kyl\u00e4n tunnettu asukas l\u00f6ytyy vuodelta 1405, h\u00e4n oli Magnus Vsskelest. Uskela oli Tyrv\u00e4nt\u00f6/Kulsialan suurimpia kyli\u00e4, keskiajan lopulla Suotaalan kanssa pit\u00e4j\u00e4n suurin. Tuolloin Uskelassa oli 13 tilaa ja alat suuria. Uskelan merkityksest\u00e4 kertoo my\u00f6s se, ett\u00e4 1500-luvun alussa hallintopit\u00e4j\u00e4k\u00e4r\u00e4j\u00e4t pidettiin aina Suotaalassa ja Uskelassa. Suurimmat tilat olivat Knuutila, Haukila, Uotila ja M\u00e4nt\u00e4l\u00e4...<br />\nIsoviha koetteli ankarasti Uskelaa ja esim. Haukila oli 1713 autiona ja muuttui kruununtilaksi...<br />\nHaukila olikruununtilana viel\u00e4 1777 isojakokirjassa. Viimeinen Gardiemeister-niminen omistaja kuoli 1829, tuolloin perint\u00f6tilaan oli liitetty jo Knuutila. Tilan perij\u00e4tt\u00e4ren nai laamanni Nils Johan Idman, Hatanp\u00e4\u00e4n kartanon, Tyk\u00f6l\u00e4n, M\u00e4nt\u00e4l\u00e4n ja moneen muun suuren tilan omistaja. Ostettuaan Uotilan Idman omisti koko Uskilan, ja entist\u00e4 kyl\u00e4\u00e4 ryhdyttiin kutsumaan Haukilan kartanoksi...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
