"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nKeuruun kyl\u00e4t - Koillis-Keuruu - Kyl\u00e4n historiaa:<br />\n\"... Olemme vedenjakaja-alueella, it\u00e4isimm\u00e4t j\u00e4rvemme Saarij\u00e4rvi ja Salosj\u00e4rvi suuntaavat Suomenlahdelle, Sammalinen, Koloj\u00e4rvi ja Asunnanj\u00e4rvi taas Kokem\u00e4enjoen vesist\u00f6\u00f6n. Vanhin v\u00e4est\u00f6 on suurelta osin savolaista alkuper\u00e4\u00e4.<br />\n... Asunnalle asettui 1590-luvulla Hokkasen suku, jonka oletetaan tulleen Kangasniemelt\u00e4. Asunta kuuluu Pohjoislahden kyl\u00e4\u00e4n, on siis niin sanottua H\u00e4meen Keuruuta, kun taas Ampiala kuului Satakunnan puolelle. Hokkasten asettumisesta Asunnalle on kerrottu montakin tarinaa. 1800-luvun alussa alueella oli vain muutamia taloja asukkaineen... Pohjoislahden kyl\u00e4\u00e4n kuuluivat Asunta, Taavettila ja Riihim\u00e4ki sek\u00e4 nykyisell\u00e4 Kalettomalla Ilvesj\u00e4rvi. Taloilla oli monia torppia ja muita asumuksia, jotka my\u00f6hemmin muuttuivat tiloiksi...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
