"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm<br />\n\"\"Huilu-Pieti\" oli ollut melko vauhdikas is\u00e4nt\u00e4mies; h\u00e4n oli saanut vuosien 1547-55 v\u00e4lill\u00e4 kahdeksan kertaa rapsut tappelusta ja nelj\u00e4sti veroniskuroinnista.<br />\nEnnen \"V\u00e4lkki-Ollia\" V\u00e4lkkil\u00e4n kyl\u00e4 oltiin aina tunnettu Hakolahtena. ... Pietari Sipinpojan kantatalon omaisuuden arvo oli 72 markkaa... H\u00e4nen talonsa oli vanha er\u00e4miestalo.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm<br />\n\"Taulu 1<br />\nI Olof Nilsson V\u00e4lkki Is\u00e4nt\u00e4 1539-1589, syntynyt noin 1515. Ensimm\u00e4inen sukuun varmuudella kuuluva esi-is\u00e4 lautamies Olavi Niilonpoika eli \"V\u00e4lkki-Olli\" (Welcke Oleff), is\u00e4nt\u00e4n\u00e4 1539-89, on todenn\u00e4k\u00f6isesti tullut taloon edellisen is\u00e4nn\u00e4n Pietari Sipinpojan \"Huilu-Pietin\" (Huilu Peti), is\u00e4nt\u00e4n\u00e4 1548-1603, v\u00e4vyksi, sill\u00e4 h\u00e4n oli ainakin t\u00e4lt\u00e4 perinyt paikan lautamiehen\u00e4 vuonna 1568 ja Pietarin talosta oli halottu h\u00e4nelle puolikas. \"Huilu-Pieti\" oli ollut melko vauhdikas is\u00e4nt\u00e4mies; h\u00e4n oli saanut vuosien 1547-55 v\u00e4lill\u00e4 kahdeksan kertaa rapsut tappelusta ja nelj\u00e4sti veroniskuroinnista.<br />\nEnnen \"V\u00e4lkki-Ollia\" V\u00e4lkkil\u00e4n kyl\u00e4 oltiin aina tunnettu Hakolahtena. Olavi Niilonpoika maksoi hopeaveroa vuonna 1571 58 markan ja 5 \u00e4yrin omaisuuden edest\u00e4, mik\u00e4 oli 55. eniten hallintopit\u00e4j\u00e4n 96 is\u00e4nn\u00e4n joukossa. Pietari Sipinpojan kantatalon omaisuuden arvo oli 72 markkaa ja sijoitus 30/96. H\u00e4nen talonsa oli vanha er\u00e4miestalo.\n</p>\n<p>\nKyl\u00e4n nimi alunperin Hakolahti, t\u00e4ss\u00e4 selvityksess\u00e4 k\u00e4ytetty rinnakkaisnime\u00e4 V\u00e4lkkil\u00e4.\n</p>\n<p>\nTalo maakirjoissa vuonna 1548 1qt (=3\u00f6re) 1b, vuonna 1556 1/8 1b, vuonna 1560 1/6 1b, vuonna 1561 5/24 1b, vuonna 1567 1/6 1b, vuonna 1572 5/24 1b (my\u00f6s 2b), vuonna 1607 1 mantal 2\u00f6re ja vuodesta 1615 1 mantal 2 hemman 4 \u00f6re. Vuonna 1639 1 mantal 4 3/4 \u00f6re 3 hemman.<br />\nTalosta erotettu osa Matts Olofssonille 1607 ja t\u00e4m\u00e4 osa liitetty takaisin 1638. Vuonna 1614 taloon liitetty Marcus Thomassonin talo 1/4 mantal 2 \u00f6re.<br />\nTalo 1626 ryttarehemman Otto Yxkulls ryttare. Vuonna 1642 rytt. under Johan Henriksson. Vuonna 1646 rytt. under Erik Perssons comp. Vuonna 1649 rytt. under Baners comp. Vuonna 1654 rytt. under Nils Baners comp. Vuonna 1656 Pastells comp. Vuonna 1657 Adrikas comp. Vuonna 1659 Liustars comp. Vuonna 1661 St\u00e5hlhanas comp. Vuonna 1666 rytt. under Brunous comp. Vuonna 1675 rytt. af ryttm. Kuhlmans comp. Vuodesta 1691 rustholli 1. ryttm. comp ja augmenttina Per Ericssonin talo (Sipil\u00e4) Taljalassa ja 1695 aug. Urdiala Henrik Philipsson (Simola).\t<br />\n...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm<br />\n\"Olavi Niilonpoika eli \"V\u00e4lkki-Olli\" ... on todenn\u00e4k\u00f6isesti tullut taloon edellisen is\u00e4nn\u00e4n Pietari Sipinpojan \"Huilu-Pietin\" ... v\u00e4vyksi, sill\u00e4 h\u00e4n oli ainakin t\u00e4lt\u00e4 perinyt paikan lautamiehen\u00e4 vuonna 1568...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm#Taulu%2019\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm#Taulu%202<br />\n\"Ei mainita l\u00e4hteiss\u00e4 mutta selvi\u00e4\u00e4 siit\u00e4 ett\u00e4 poikansa Thomas Olofsson mainitaan olevan Isotalon Lars Olofssonin broderson.\"\t\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
