"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm#Taulu%203\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm#Taulu%204\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm#Taulu%208<br />\n\"Taulu 8<br />\nV Carl Jacobsson Isotalo, (Taulusta 4, is\u00e4 Jacob Isotalo) Huovilan is\u00e4nt\u00e4 1681-1709, syntynyt noin 1652 Urjala, V\u00e4lkkil\u00e4, kuollut 29.11.1730 Urjala, V\u00e4lkkil\u00e4, Isotalo. Urjalan kuudennusmies 1697. Urjalan kirkontilien hautausmaksut 1683-1686 V\u00e4lckil\u00e4 f\u00f6r Carls barn 3:-. Urjalan kirkontilien hautausmaksut 1688 V\u00e4lkil\u00e4 Carls barns l\u00e4gerstelle 3:-. Urjalan kirkontilien hautausmaksut 1694 V\u00e4lcki Carls barns l\u00e4gerstadh 3:-. Urjalan kirkontilien hautausmaksut 22.2.1702 V\u00e4lckil\u00e4 Kirstin Carlsdr begr. i kyrckian 6:-.<br />\nTurun k\u00e4mnerioikeus 15.1.1692: Bonde Carl Jacobsson ifr\u00e5n Urjala och V\u00e4lkkil\u00e4 by mot borgare Eric P\u00e5lack (velka-asia). Carlin takaajina Grels Larsson ifr\u00e5n Perho by och Michel Mattsson ifr\u00e5n Kockois by. Tuomitaan Carl maksamaan velkansa 42 d. c.m. Ericille.<br />\nUrjalan k\u00e4r\u00e4j\u00e4t v. 1707: Carl Jacobsson mot Michel Mattsson om en qvinsfolks zadel hvilken blifvit des hustrus tildelt, Carls m\u00e5g J\u00f6ran Davidsson i Ikaala.<br />\nUrjalan k\u00e4r\u00e4j\u00e4t v. 1726: Brita Mattsdotter ifr\u00e5n P\u00e4tsiniemi mot rusth\u00e5llare Carl Jacobsson ifr\u00e5n V\u00e4lkkil\u00e4. H\u00e4sthandel 30 \u00e5r sedan. Carl til hennes moder lefvererat 200 d. k.\t<br />\n...\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm#Taulu%208\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nhttps://www.karisalmi.fi/huovila.htm#Taulu%209<br />\n\"Taulu 9<br />\nVI Maria Carlsdotter Isotalo, (Taulusta 8, is\u00e4 Carl Isotalo) syntynyt 24.3.1680 Urjala, V\u00e4lkkil\u00e4, Isotalo, kuollut 5.4.1761 Urjala, Ikaala.\t\n</p>\n<p>\nPuoliso: Vihitty noin 1702 Urjala, V\u00e4lkkil\u00e4 J\u00f6ran Davidsson Isotalo Rusthollari, syntynyt noin 1666, kuollut 2.7.1741 Urjala, Ikaala. <br />\nPuolison vanhempia: <br />\n   \t(i)\tDavid.<br />\n   \t(\u00e4)\tN.N.<br />\nIs\u00e4nt\u00e4n\u00e4 1704-1737. Mainitaan SAYssa ensimm\u00e4isen kerran v. 1705.<br />\nPerunkirjoitus 22.6.1742 Ikaala rusth\u00e5ll framledne rusth\u00e5llare J\u00f6ran Davisson, enka Maria Carlsdotter, tre s\u00f6ner David, Carl och Jacob, tv\u00e4nne d\u00f6ttrar Kirstin gift med rusth\u00e5llare Jacob Henricsson ifr\u00e5n Menois Mattila, Maria J\u00f6ransdotter 25 \u00e5r. Sonen Carl \u00e4r borgare i \u00c5bo. Velkoja Thomas Thomasson Rauko i Risikkala by, Thomas Henricsson ibm.<br />\nUrjalan k\u00e4r\u00e4j\u00e4t 28.11.1761 \u00a717: rusth\u00e5llare Jacob J\u00f6ransson ifr\u00e5n Kockois, syster rusth\u00e5llare \u00e4nka Kirstin J\u00f6ransdotter i Menois, arfskifte efter theras aflidne fader rusth\u00e5llare J\u00f6ran Davidsson Ikaala, efterl\u00e4mnade \u00e4nka Maria Carlsdotter, broder rusth\u00e5llare David J\u00f6ransson, afledne syster Maria J\u00f6ransdotter, broder b\u00e5rgare i \u00c5bo stad Carl J\u00f6ransson Ikalin.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
